import React from "react";
import Footer from "../../components/Footer/Footer";
import MealsCard from "../../components/MealsCard/MealsCard";
import Navbar from "../../components/Navbar/Navbar";
import "./listOfMeals.css";

const ListOfMeals = () => {
  return (
    <div className="mealsList">
      <Navbar />
      <div className="mealsList-content">
        <div className="mealsList-title">List of guests</div>

        <div className="mealsList-search">
          <input type="text" placeholder="Enter name of guest" />
        </div>

        <div className="mealsList-list">
          <MealsCard />
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default ListOfMeals;
